/*
 * Copyright (c) 2020. Adam Arthur Faizal.
 */

import React, {Component} from "react";
import './App.css'
import './dist/css/bootstrap.min.css';

class AppNav extends Component {
    render() {
        return (
            <div className="App-nav navbar navbar-dark bg-secondary fixed-top">
                <div className="container-fluid">
                    <a className="navbar-brand font-weight-bold">
                        Adam Arthur Faizal
                    </a>
                    <button className="navbar-toggler" type="button" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse">
                        <div className="navbar-nav">
                            <a href="#" className="nav-item nav-link">React Version : {React.version}</a>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default AppNav;
